---//==================================================\\---
--|| > Script Initialization                            ||--
---\\==================================================//---

_G.DevnsAutoPotions_DisableAutoUpdate = false

assert(load(Base64Decode(""), nil, "bt", _ENV))()

---//==================================================\\---
--|| > Script Variables                                 ||--
---\\==================================================//---

_ENV.ScriptName = "Devn's Auto-Potions"
_ENV.ScriptVariables = "DevnsAutoPotions"
_ENV.CurrentVersion = "1.00"
_ENV.BuildDate = "2015/08/18"
_ENV.LeagueVersion = "5.15 HF"
_ENV.StatusKey = ""

_ENV.IsAutoPotionsScript = true

_ENV.UpdatePath = "DevnBoL/BoL1.0Scripts/master/DevnsAutoPotions/"

local Config = nil
local Readme = nil
local Changelog = nil
local Items = nil

_G.DevnsAutoPotions_Loaded = true

---//==================================================\\---
--|| > Callback Handlers                                ||--
---\\==================================================//---

Callbacks:Bind("Load", function()
	SetupVariables()
	SetupConfig()
end)
Callbacks:Bind("Tick", function()
	if (JustUpdated) then
		local title = Changelog.Title
		Changelog.Title = "Updated to v"..CurrentVersion
		Changelog.Callback = function() Changelog.Title = title end
		Changelog:Show()
		JustUpdated = false
		return
	end
	if (not Config.Readme) then return end
	Config.Readme = false
	Config:save()
	if (Readme.Visible or Changelog.Visible) then return end
	Readme:Show()
end)

---//==================================================\\---
--|| > Script Setup                                     ||--
---\\==================================================//---

function SetupVariables()
	SetupClassVariables()
	SetupReadmeVariables()
end
function SetupConfig()
	Config:KeyBinding("Combo", "Combo Mode Key", false, 32)
	SetKeysConfig(Config)
	Config:Separator()
	Items:LoadPotionsToConfig(Config)
	Config:Separator()
	Config:Toggle("Readme", "Show Readme & Changelog", true)
	Config:Separator()
	Config:Info("Version", CurrentVersion)
	Config:Info("Build Date", BuildDate)
	Config:Info("Tested With LoL", LeagueVersion)
	Config:Info("Author", "Devn")
end

function SetupClassVariables()
	Config = MenuConfig(ScriptVariables, ScriptName)
	Items = ItemManager()
end
function SetupReadmeVariables()
	Readme = DialogBox("Readme")
	Readme:Add("About Script:")
	Readme:Add("Small auto-potion script because there is none on the forum with a toggle to only use")
	Readme:Add("potion during combo mode. It's a pretty small script because everything is done")
	Readme:Add("through GodLib.")
	Readme:Add()
	Readme:Add("Bugs/Errors:")
	Readme:Add("If you get any bugs or errors while using this script please take a screenshot (if you")
	Readme:Add("can) and report it to the forum thread!")
	Readme:Add()
	Readme:Add("If you like this script please leave a like on the forum thread and on script status! :D")
	Readme:AddButton("Show Changelog", function()
		Readme:Close()
		Changelog:Show()
	end, 150)
	Changelog = DialogBox("Changelog")
	Changelog:Add("Version 1.00:")
	Changelog:Add("-t- Initial script release.")
	Changelog:AddButton("Readme", function()
		Changelog:Close()
		Readme:Show()
	end)
end
